import React from 'react';
import {FaFacebookSquare } from "react-icons/fa";
import { FaGithubSquare } from "react-icons/fa";
import { FaLinkedin } from "react-icons/fa";



function Card(){
    return(
        <>
<div className="card">
<div className="heading">
</div>
<img className="profile" src="./Image/Sank.jpg" alt=""/>
    <h1 class="name">SHASHANK TIWARI</h1>
<div class="icon">
<ul>
<IconContext.Provider value={{color: 'navy', size: 42}}>
   <a href=" "> <li><FaFacebookSquare/></li></a>
   <a href=" "><li><FaGithubSquare/></li></a>
    <a href=" "><li><FaLinkedin/></li></a>
    </IconContext.Provider>
    
</ul>
</div>
</div>




</>
    );
}
export default Card;
